import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import titleLogo from '../../images/shittybookicon.svg'
import dropDownLogo from '../../images/shittydropdown.svg'

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false)

  const handleNavbar = () => setToggleMenu(!toggleMenu)

  return (
    <nav className='navbar' id='navbar'>
        <div className='navbar-content'>
          <div className='brand-and-toggler'>
            <Link to = '/' className='navbar-brand'>
              <img src={titleLogo} alt='site logo' />
              <p className='site-title'></p>
            </Link>
            <button type='button' className='navbar-toggler' 
            onClick={handleNavbar}>
              <img src={dropDownLogo} alt="drop down logo"/>
            </button>
          </div>

          <div className={toggleMenu ? "navbar-show" : "navbar-collapse"}>
            <ul className='navbar-dropdown'></ul>
          </div>

        </div>
    </nav>

  )
}

export default Navbar
